import { withRouter } from "react-router-dom";
import { getToken } from "../../helpers/user";

const Dashboard = () => {
  useEffect(() => {
    const value = getToken();

    if (!value) {
      console.log("usuario no logueado");
    }
  }, []);
  return (
    <div>
      <h1>Dashboard protegido</h1>
    </div>
  );
};

export default withRouter(Dashboard);
